import React from "react";

const Navbar = () => {
  return (
    <div>
      <nav className=" w-screen bg-primary p-3 flex justify-center">
        <div className="nav-content">
          <div className="logo">
            <h1>Logo</h1>
          </div>
        </div>
      </nav>
    </div>
  );
};

export default Navbar;
